/* eslint-disable react/button-has-type */
import React from "react";

export default function notFound() {
  return (
    <div className="bg-gray-background">
      <div className="mx-auto max-w-screen-lg place-content-center">
        <p className="text-center text-2xl font-bold">404 Page not found</p>
        <button className="bg-blue-medium	 rounded-full px-8 py-2 text-white">
          Save Changes
        </button>
      </div>
    </div>
  );
}
